//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Token is Ownable {
    //address inspector = "0x3b54979b144A6E856d3a2345c3d58c0C737eBE67";
    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowed;

    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    event Approval(address indexed _owner, address indexed _spender, uint256 _value);

    string public symbol;
    string public name;
    uint8 public decimals;
    uint256 private _totalSupply;

    constructor() {
        symbol = "VT1";
        name = "Test1";
        decimals = 18;
        _totalSupply = 10000;
        _balances[0x5B38Da6a701c568545dCfcB03FcB875f56beddC4] = 6000;
        emit Transfer(address(0), 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4, 6000);
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address _owner) public view returns (uint256 balance){
        return _balances[_owner];
    }

    function allowance(address _owner, address _spender) public view returns (uint256 remaining){
        return _allowed[_owner][_spender];
    }

    function transfer(address _to, uint256 _value) public returns (bool success){
        require(_to != address(0), "transfer to zero address");
        require(_value <= _balances[msg.sender], "not enough balance");
        require(_value >= 0, "value must be greater than 0");

        _balances[msg.sender] = _balances[msg.sender] - _value;
        _balances[_to] = _balances[_to] + _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success){
        require(_to != address(0), "transfer to zero address");
        require(_value <= _balances[_from], "not enough balance");
        require(_value <= _allowed[_from][msg.sender], "not enough allowance");
        require(_value >= 0, "value must be greater than 0");

        _balances[_from] = _balances[_from] - _value;
        _allowed[_from][msg.sender] = _allowed[_from][msg.sender] - _value;
        _balances[_to] = _balances[_to] + _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success){
        require(_value > 0, "value must be greater than 0");

        _allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function mint(uint256 _value) public onlyOwner{
        require(_value != 0, "value must be greater than 0");

        _totalSupply = _totalSupply + _value;
        _balances[msg.sender] = _balances[msg.sender] + _value;
        emit Transfer(address(0), msg.sender, _value);
    }
}

